<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <title>Myanmar FIRMS Real Time Monitoring System</title>
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"/>
  <link rel="stylesheet" href="https://unpkg.com/leaflet.markercluster@1.5.3/dist/MarkerCluster.css"/>
  <link rel="stylesheet" href="https://unpkg.com/leaflet.markercluster@1.5.3/dist/MarkerCluster.Default.css"/>
  <style>
    html, body, #map { height:100%; margin:0; padding:0; }
    .top-controls {
      position: absolute;
      top: 10px;
      left: 10px;
      z-index: 1200;
      background: rgba(255,255,255,0.95);
      padding: 8px;
      border-radius: 8px;
      box-shadow: 0 2px 6px rgba(0,0,0,0.2);
      font-family: sans-serif;
      display: flex;
      gap: 8px;
      align-items: center;
    }
    .top-controls select, .top-controls button {
      padding: 6px 8px;
      font-size: 13px;
    }
    .slider-container { position:absolute; bottom:10px; left:10px; z-index:1100; }
    .legend { position:absolute; bottom:100px; left:10px; z-index:1100; background:white; padding:8px; border-radius:6px; box-shadow:0 1px 4px rgba(0,0,0,0.2); font-size:13px;}
    #statusBox { position:absolute; top:50px; right:10px; z-index:1200; background:rgba(255,255,255,0.95); padding:8px; border-radius:6px; box-shadow:0 1px 4px rgba(0,0,0,0.2); font-weight:600;}
  </style>
</head>
<body>
  <div id="map"></div>

<div class="top-controls">
  <label for="dateSelect">Date:</label>
  <select id="dateSelect"></select>

  <button id="filterButton">Filter to Myanmar Boundary</button>
  <button id="downloadBtn">üì• Download CSV (filtered)</button>
  <button id="homeBtn">üè† Home</button>
</div>

<script>
  document.getElementById('homeBtn').addEventListener('click', () => {
    window.location.href = 'index.html';
  });
</script>

  <div class="legend" id="legend"></div>
  <div id="statusBox">Loading‚Ä¶</div>

  <!-- libs -->
  <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
  <script src="https://unpkg.com/leaflet.markercluster@1.5.3/dist/leaflet.markercluster.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/papaparse@5.4.1/papaparse.min.js"></script>
  <script src="https://unpkg.com/@mapbox/leaflet-pip@latest/leaflet-pip.min.js"></script>

  <script>
  // ====== CONFIG ======
  const API_KEY = "b044fb3b2cc54666aefc31c214d1119e"; // <-- replace if you have your own key
  const DAYS = 7; // last 7 days
  const MYANMAR_BBOX = { minLng: 92.0, minLat: 9.5, maxLng: 101.2, maxLat: 28.5 };

  const datasets = [
    { name: "VIIRS_NOAA20_NRT", color: "#e41a1c", title: "VIIRS NOAA-20" },
    { name: "VIIRS_NOAA21_NRT", color: "#4daf4a", title: "VIIRS NOAA-21" },
    { name: "VIIRS_SNPP_NRT",  color: "#377eb8", title: "VIIRS SNPP" },
    { name: "MODIS_NRT",       color: "#ff7f00", title: "MODIS TERRA/AQUA" }
  ];

  // ====== Map init ======
  const map = L.map('map').setView([19.8, 96.6], 6);

 const hybrid = L.tileLayer("https://mt1.google.com/vt/lyrs=y&x={x}&y={y}&z={z}", {
    attribution: "Google Hybrid"
  }).addTo(map);

 const osm = L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", {
    attribution: '&copy; OpenStreetMap contributors'
  });

  // marker cluster groups per dataset
  const datasetLayers = {};
  datasets.forEach(ds => datasetLayers[ds.name] = L.markerClusterGroup());

  // layer control
  const baseMaps = { "Satellite (Hybrid)": hybrid, "OSM": osm };
  const overlayMaps = {};
  datasets.forEach(ds => overlayMaps[ds.title] = datasetLayers[ds.name]);
  const layersControl = L.control.layers(baseMaps, overlayMaps, { collapsed: false }).addTo(map);

  // legend
  function updateLegend() {
    let html = "<b>Datasets</b><br/>";
    datasets.forEach(ds => {
      html += `<div style="margin-bottom:6px;"><span style="display:inline-block;width:12px;height:12px;background:${ds.color};margin-right:8px;border:1px solid #333;vertical-align:middle;"></span>${ds.title}</div>`;
    });
    document.getElementById('legend').innerHTML = html;
  }
  updateLegend();

  // status
  const statusBox = document.getElementById('statusBox');

  // Myanmar polygon
  let myanmarBoundaryLayer = null;

  // store parsed data
  const allData = {}; // datasetName => [records]
  const csvFieldsUnion = new Set(); // to build CSV header later

  // build date list for last 7 days (YYYY-MM-DD), oldest ‚Üí newest shown as options (so user can pick any day)
  function getDateList(days) {
    const list = [];
    const today = new Date();
    for (let i = 0; i < days; i++) {
      const d = new Date(today.getTime() - (days - 1 - i) * 24*3600*1000);
      list.push(d.toISOString().split('T')[0]);
    }
    return list;
  }

  // populate dateSelect
  const dateSelect = document.getElementById('dateSelect');
  function populateDateSelect() {
    const dates = getDateList(DAYS);
    dateSelect.innerHTML = '';
    const optAll = document.createElement('option');
    optAll.value = 'ALL';
    optAll.textContent = 'All days';
    dateSelect.appendChild(optAll);
    dates.forEach(d => {
      const opt = document.createElement('option');
      opt.value = d;
      opt.textContent = d;
      dateSelect.appendChild(opt);
    });
    // default: show All
    dateSelect.value = 'ALL';
  }
  populateDateSelect();

      function utcToMMT(utcStr) {
      utcStr = utcStr.trim().padStart(4, '0');
      const h = parseInt(utcStr.slice(0, 2), 10);
      const m = parseInt(utcStr.slice(2), 10);
      const utcMillis = (h * 60 + m) * 60 * 1000;
      const mmtMillis = utcMillis + (6.5 * 60 * 60 * 1000);
      const mmtDate = new Date(mmtMillis);
      const hh = mmtDate.getUTCHours().toString().padStart(2, "0");
      const mm = mmtDate.getUTCMinutes().toString().padStart(2, "0");
      return `${hh}:${mm}`;
    }

  // popup HTML (show UTC date/time directly)
  function popupHtml(rec, datasetTitle) {
    const acq_time = rec.acq_time || '';
    const  mmtTime = utcToMMT(acq_time);
    return `<b>${datasetTitle}</b><br/>
            <b>Date (UTC):</b> ${rec.acq_date || 'N/A'} ${acq_time} <br/>
            <b>Time (MM):</b> ${mmtTime} <br/>
            <b>Lat,Lon:</b> ${Number(rec.latitude).toFixed(4)}, ${Number(rec.longitude).toFixed(4)}<br/>
            <b>Brightness:</b> ${rec.brightness ?? rec.bright_ti4 ?? 'N/A'}<br/>
            <b>Confidence:</b> ${rec.confidence ?? 'N/A'}<br/>
            <b>Satellite:</b> ${rec.satellite ?? 'N/A'}<br/>
            <b>Instrument:</b> ${rec.instrument ?? 'N/A'}<br/>
            <b>FRP:</b> ${rec.frp ?? 'N/A'}`;
  }

  // create markers for one dataset, using filters
  function createMarkersForDataset(datasetName, color, records, filterPolygon=false, dateFilter=null) {
    const layer = datasetLayers[datasetName];
    layer.clearLayers();
    if (!records || !records.length) return;

    const used = [];
    for (const rec of records) {
      const lat = parseFloat(rec.latitude);
      const lon = parseFloat(rec.longitude);
      if (!isFinite(lat) || !isFinite(lon)) continue;

      // date filter
      if (dateFilter && dateFilter !== 'ALL' && rec.acq_date !== dateFilter) continue;

      // polygon filter (only use polygon; do NOT fallback to bbox)
      if (filterPolygon) {
        if (!myanmarBoundaryLayer) continue; // boundary missing => skip
        const inside = leafletPip.pointInLayer([lon, lat], myanmarBoundaryLayer);
        if (!inside.length) continue;
      }

      // marker size from frp if available
      const size = rec.frp && !isNaN(rec.frp) ? Math.min(20, 4 + Math.sqrt(Number(rec.frp))) : 6;

      const marker = L.circleMarker([lat, lon], {
        radius: size,
        weight: 1,
        color: '#333',
        fillColor: color,
        fillOpacity: 0.85,
        opacity: 0.9
      });

      marker.bindPopup(popupHtml(rec, datasets.find(d => d.name === datasetName).title));
      layer.addLayer(marker);
      used.push(rec);
    }
    return used.length;
  }

  // fetch and parse datasets (area/csv)
  async function fetchDataset(ds) {
    const url = `https://firms.modaps.eosdis.nasa.gov/api/area/csv/${API_KEY}/${ds.name}/${MYANMAR_BBOX.minLng},${MYANMAR_BBOX.minLat},${MYANMAR_BBOX.maxLng},${MYANMAR_BBOX.maxLat}/${DAYS}`;
    statusBox.textContent = `Fetching ${ds.title}...`;
    try {
      const res = await fetch(url);
      const txt = await res.text();
      const parsed = Papa.parse(txt, { header: true, dynamicTyping: false, skipEmptyLines: true });
      allData[ds.name] = parsed.data || [];
      // union fields (use parsed.meta.fields if available)
      if (parsed.meta && parsed.meta.fields) parsed.meta.fields.forEach(f => csvFieldsUnion.add(f));
      else if (allData[ds.name].length) Object.keys(allData[ds.name][0]).forEach(f => csvFieldsUnion.add(f));
      // initially create markers (no polygon filter)
      const count = createMarkersForDataset(ds.name, ds.color, allData[ds.name], filterButtonActive(), getCurrentDateFilter());
      statusBox.textContent = `Loaded ${ds.title}: ${allData[ds.name].length || 0} rows, ${count || 0} displayed`;
      // add layer to overlay control (if not already)
      if (!map.hasLayer(datasetLayers[ds.name])) map.addLayer(datasetLayers[ds.name]);
    } catch (err) {
      console.error('Fetch error', err);
      statusBox.textContent = `Error loading ${ds.title}`;
    }
  }

  // helper to get currently selected date from dropdown
  function getCurrentDateFilter() {
    const v = dateSelect.value;
    return v || 'ALL';
  }

  // refresh all layers using current filters
  function refreshAllLayers() {
    const dateFilter = getCurrentDateFilter();
    let totalDisplayed = 0;
    datasets.forEach(ds => {
      const displayed = createMarkersForDataset(ds.name, ds.color, allData[ds.name], filterButtonActive(), dateFilter) || 0;
      totalDisplayed += displayed;
    });
    statusBox.textContent = `Showing ${totalDisplayed} hotspots (${dateFilter === 'ALL' ? 'All days' : dateFilter})`;
  }

  // filter button state function
  function filterButtonActive() {
    return document.getElementById('filterButton').classList.contains('active');
  }

  // CSV download for currently filtered records (combines datasets)
  function downloadFilteredCSV() {
    // build header fields array from union set, prefer an order that's meaningful
    const preferred = ['latitude','longitude','acq_date','acq_time','satellite','instrument','brightness','bright_ti4','confidence','frp'];
    const fields = [];
    const union = Array.from(csvFieldsUnion);
    // push preferred if present
    preferred.forEach(f => { if (union.includes(f)) fields.push(f); });
    // then add remaining union fields not included
    union.forEach(f => { if (!fields.includes(f)) fields.push(f); });

    // collect rows
    const rows = [];
    const dateFilter = getCurrentDateFilter();
    const polyActive = filterButtonActive();

    datasets.forEach(ds => {
      const recs = allData[ds.name] || [];
      for (const rec of recs) {
        if (dateFilter !== 'ALL' && rec.acq_date !== dateFilter) continue;
        if (polyActive) {
          if (!myanmarBoundaryLayer) continue;
          if (!leafletPip.pointInLayer([Number(rec.longitude), Number(rec.latitude)], myanmarBoundaryLayer).length) continue;
        }
        // create row values in fields order
        const row = fields.map(k => {
          // ensure string and escape quotes
          let v = (rec[k] !== undefined && rec[k] !== null) ? String(rec[k]) : '';
          // if contains comma or quote or newline, wrap in quotes and escape quotes
          if (v.indexOf('"') !== -1) v = v.replace(/"/g,'""');
          if (v.indexOf(',') !== -1 || v.indexOf('"') !== -1 || v.indexOf('\n') !== -1) v = `"${v}"`;
          return v;
        });
        rows.push(row.join(','));
      }
    });

    if (rows.length === 0) {
      alert('No rows match current filters.');
      return;
    }

    const csvContent = fields.join(',') + '\n' + rows.join('\n');
    const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    const dateStr = (dateFilter === 'ALL') ? 'all_days' : dateFilter;
    a.href = url;
    a.download = `hotspots_filtered_${dateStr}.csv`;
    document.body.appendChild(a);
    a.click();
    a.remove();
    URL.revokeObjectURL(url);
  }
